import axios from "axios";

const api = axios.create({
  baseURL: `https://api.trello.com/1/boards/${process.env.REACT_APP_TRELLO_ID}/labels?key=${process.env.REACT_APP_TRELLO_KEY}&token=${process.env.REACT_APP_TRELLO_TOKEN}&name={name}&color={color}`
})

export default api;
